import React from 'react';
import { Link, withRouter } from 'react-router-dom';
import { getChanels } from '../controllers/ChanelController';


class Chanels extends React.Component {
    constructor() {
        super();
        this.state = {
            chanels: [],
        }
    }

    componentDidMount() {
        try {
            // Get chanels
            getChanels()
            .then(res => {
                if (!res.message) {
                    this.setState({
                        chanels: res
                    });
                }
            });
        } catch (e) { console.log(e) }
    }

    render() {
        let { chanels } = this.state;
        return (
            <div className="discussions" id="scroller">
                <div className="list-group chats" id="chats">
                    {
                        chanels.map((cn, index) => {
                            return <Link id={`dcs_${cn._id}`} tabIndex={index} key={index} to={`/chanels/${cn._id}`} className="item-discussions single unread">
                                <img className="avatar-md" src={cn.chanelPhoto.photoIcon} alt="chanel-icon" />
                                <div className="status online" />
                                <div className="data">
                                    <h5>{cn.chanelName}</h5>
                                    {/* <div className="new bg-red">
                                        <span>9+</span>
                                    </div> */}
                                    <span>Sun</span>
                                    <p>{}</p>
                                </div>
                            </Link>
                        })
                    }
                    <a href="#list-chat" className="item-discussions single unread">
                        <img className="avatar-md" src="https://res.cloudinary.com/dged6fqkf/image/upload/v1581180816/gijehzwgb0ddchnigupc.gif" alt="avt" />
                        <div className="status online" />
                        <div className="data">
                            <h5>Bob Frank</h5>

                        </div>
                    </a>
                    <div className="scroller" />
                </div>
            </div>
        )
    }
}

export default withRouter(Chanels);
